import React, { Component } from 'react';

class Rates extends Component {
    constructor(props){
        super(props)
        this.state = {
            currency: "GBP"
        }
    }

    render(){
        return(
            <div>
                <select>
                    {this.props.rates.rates.map((rate, index) => {
                        return(
                            <option value={rate}>{rate}</option>
                        )
                    })}
                </select>
            </div>
        )
    }
}

export default Rates;
